export const fetchRandomRecipe = async () => {
  const response = await axios.get(`${RECIPE_API}/randomten`);
  return response.data.map((recipe) => {
    return {
      ...recipe,
      likeCount: 10,
      commentCount: 20,
      userId: "654ffdd3870c092d5441bc8d",
    };
  });
};

